import fs from "fs";
import path from "path";
import { fetchMlServer } from "../fetch-ml-server.mjs";
import { escapeStr, escapeNum } from "../sql-utils.mjs";
import { rootDir } from "../constants.mjs";

// Images list as json
// http://localhost:3000/images/

// Image as bytes stream
// http://localhost:3000/images/original/NBO-new_tulips.png

// Image as base64 encoded stream
// http://localhost:3000/images/base64/NBO-new_tulips.png

export const handlers = (app) => (sql) => {
  app.get("/api/images/:id", async (req, res) => {
    try {
      const promptId = String(req.params.id);

      const [{ ReqCnt }] =
        await sql(`SELECT Count(*) AS "ReqCnt" FROM "PromptsRequests"
          WHERE "PromptId" = ${escapeStr(promptId)} 
        `);
      if (!(ReqCnt > 0)) {
        throw new Error(`Request ${promptId} not present in database requests`);
      }

      const images = await sql(
        `SELECT "ImageContent" FROM "PromptsResponses"
         WHERE "PromptId" = ${escapeStr(promptId)}`,
      );
      if (images.length > 0) {
        res.json(images.map(({ ImageContent }) => ImageContent));
        return;
      }

      const response = await fetchMlServer({
        method: "GET",
        url: `/?id=${req.params.id}`,
      });

      // TODO client id
      // const response = [
      //   "",
      //   "",
      //   "",
      // ];

      for (let idx = 0; idx < response.length; idx++) {
        await sql(
          `INSERT INTO "PromptsResponses"(
            "PromptId",
            "ImageIdx",
            "ImageContent"
          ) VALUES (
            ${escapeStr(promptId)},
            ${escapeNum(idx)},
            ${escapeStr(response[idx])}
          )
          ON CONFLICT("PromptId", "ImageIdx") 
          DO UPDATE SET "ImageContent" = ${escapeStr(response[idx])}
          ;`,
          true,
        );
      }

      res.json(response);
    } catch (error) {
      console.error(error.stack);
      res.status(400);
      res.end(`${error}`);
    }
  });
};
